import React, { Component } from 'react';
//import logo from './logo.svg';
import './Home.css';

function Event(props){
  let state = {
    //eventID:this.props.eventID,
    name:props.name,
    description:props.description,
    //eventIdentifier: this.props.eventIdentifier,
  };

  
  return(
    <div>
      
      <p id='eventName'>{state.name}</p>
      <p id='eventDesc'>{state.description}</p>
      <button>Edit</button>
      <button>Delete</button>
    </div>
  );
}

//<p id='eventIdentifier'>{this.props.eventID}</p>

let myEvent ={
  eventID: 'hello',
  name: 'what up',
  description:'the best',
  eventIdentifier: 'alright',
};

//eventID={myEvent.eventID}

class Home extends Component {

 
  render() {
    return (
        <div className="App">
          <header className="App-header">
            <p>
              Thank you for using My App! 
            </p>
          </header>
          <Event
           
            name={myEvent.name}
            description={myEvent.description}
          />
        </div>
    );
  }
}
export default Home;
